import React from 'react'
import './topbar.css'

function Topbar() {


	return (
	 <div className='bar'>
	   <div className='leftbar'><i class="fa-brands fa-facebook"></i></div>
	   <div className='centerbar'><i class="fa-brands fa-facebook"></i></div>
	   <div className='rightbar'><i class="fa-brands fa-facebook"></i></div>
	 </div>
	)
}

export default Topbar
